import React, { useState } from "react";
import "./NavBar.css";
import { Logo, Changer, MenuIcon } from "../assets";
import {NavLink} from 'react-router-dom'


document.getElementById("theme-changing-button").addEventListener(click, )
    document.body.style.backgroundColor = "#17161B";
const NavBar = () => {

    const [toggleMenu, setToggleMenu] = useState(false);

    return (
        <>
            <div className="navbar-container">
                <div className="navbar-logo">
                    <img src={Logo} alt="" />
                </div>
                <div className="navbar-links">
                <NavLink to="/empty" className="navLink">Buy a house</NavLink>
                    <NavLink to="/empty" className="navLink">Rent a house</NavLink>
                    <NavLink to="/empty" className="navLink">Mortgage</NavLink>

                </div>





                <div className="theme-changer">
                    <button className="theme-changing-button"><img src={Changer} alt="" /></button>
                </div>
            </div>
        </>
    );
};

export default NavBar;
